function getimgtabs(imgtype) {	
	$.ajax({  
        url:"/getbasemaptypebyprojectid",		
        data:{
        	groupid:parseInt($("#grouplist").val()),
        	imgtype:imgtype
			},  
        type:"post",  
        async: false,
        dataType:"json", 
        success:function(data)  
        {       	  
        	if(data!=null && data.length>0)
    		{	        
        		dialogConfig.body.tabs=[];
        		//$('#nav_pictype .itempage').remove();
        		for(var i=0;i<data.length;i++)
				{
        			var classify=data[i].classify;
        			if(classify==null || classify=="")
        				{classify="共享";}
        			var tab={
    						name: classify,
          	  		        title: classify,
          	  		        tems: [{
          			  	        type: 'htmlpanel',
          			  	        html: "<div></div>"
          		  	        }]
        				}
        			if(i==0)//选中第一项,加图
        				{   
        						        			
        				}  
        			dialogConfig.body.tabs.push(tab);
				}
    		}
        	else
        		{
        			alert(data.resultMessage);
        		}
        },  
        error: function() {  
        	alert("ajax 函数  getbasemaptypebyprojectid 错误");            
          }  
    });
}